package principal;

import java.util.Scanner;

public class App {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		System.out.println("Impares del 333 al 999 con while");
		System.out.println("*********************************");
		int numero=333;
		while(numero<=999) {
			System.out.println(numero);
			numero+=2;
		}
		
		
		
	}

}
